import React from 'react'
import axios from '../../config/axios'

class List extends React.Component{
    constructor(){
        super()
        this.state = {
            contacts : []
        }
    }

    componentDidMount(){
        axios.get('/contacts')
            .then(response => {
                const contact = response.data
                this.setState({contact})
                console.log('contact',contact)
            })
            .catch(err => {
                console.log(err)
            })
    }

    render(){
        return(
            <div>
                <h3>Contact List:-{this.state.contacts.length}</h3>
                    <ul>
                        {
                            this.state.contacts.map(cont => {
                                return <li key={cont.id}>{cont.firstName}</li>
                            })
                        }
                    </ul>
            </div>
        )
    }
}

export default List
